apiVersion: v1
kind: ConfigMap
metadata:
  name: {{ include "var.fullname" . }}-jupyter-scripts-config
data:
  getfiles.sh: |-
     echo "# my notebooks settings
     c = get_config()
     from jupyter_server.auth import passwd
     password = passwd('vector')
     c.NotebookApp.password = password
     c.NotebookApp.base_url = '/jupyter/{{ .Release.Name }}'" >> /home/jovyan/.jupyter/jupyter_server_config.py
     wget https://download.oracle.com/otn_software/linux/instantclient/2350000/instantclient-basic-linux.x64-23.5.0.24.07.zip
     unzip instantclient-basic-linux.x64-23.5.0.24.07.zip -d /home/jovyan/.jupyter
     cp /scripts/libaio.so.1 /home/jovyan/.jupyter/instantclient_23_5
     cd /home/jovyan
     mkdir .ssh
     cp /ssh/* .ssh
     chmod 600 .ssh/*
     cd /tmp
     git clone ssh://devops.scmservice.eu-frankfurt-1.oci.oraclecloud.com/namespaces/oractdemeabdmnative/projects/aiworkshop/repositories/aiworkshop-scripts
     cp -R aiworkshop-scripts/dbscripts/* /home/jovyan/work

binaryData:
  libaio.so.1: 


